import React from "react";
import logo from "./logo.svg";
import itunes from "./itunes.svg";
import instagram from "./instagram.png";
import spotify from "./spotify.png";
import youtube from "./youtube.png";
import applemusic from "./applemusic.svg";
import tidal from "./tidal.png";
import soundcloud from "./soundcloud.png";
import { Links } from "./Link";
import "./App.css";

function App() {
  const links = [
    [spotify, "https://bit.ly/LAURENT-SPOTIFY"],
    [applemusic, "https://bit.ly/LAURENT-APPLE-MUSIC"],
    [tidal, "https://bit.ly/LAURENT-TIDAL"],
    [youtube, "https://bit.ly/LAURENT-YOUTUBE-CHANNEL"],
    [soundcloud, "https://bit.ly/LAURENT-SOUNDCLOUD"]
  ];
  return (
    <div className="App">
      <Links links={links} />
    </div>
  );
}

export default App;
